# --- CONFIGURATION (Point A: Structure) ---
BASE_URL = "https://finance.yahoo.com/most-active"
ROBOTS_URL = "https://finance.yahoo.com/robots.txt"
DATA_DIR = "data"
FILENAME = f"yahoo_stocks_{datetime.now().strftime('%Y-%m-%d')}.csv"

# --- HEADERS √âTHIQUES (Point B: √âthique) ---
# On s'identifie clairement sans se faire passer pour un robot malveillant
HEADERS = {
    'User-Agent': 'Mozilla/5.0 (Student Project; Contact: nadya.debeers@hotmail.com)',
    'Accept-Language': 'en-US,en;q=0.9',
}

def check_robots_txt(url, user_agent):
    """
    (Point B: L√©galit√©) V√©rifie si le scraping est autoris√© par le site.
    """
    try:
        rp = urllib.robotparser.RobotFileParser()
        rp.set_url(ROBOTS_URL)
        rp.read()
        allowed = rp.can_fetch(user_agent, url)
        if allowed:
            print(f"‚úÖ Autorisation Robots.txt accord√©e pour : {url}")
        else:
            print(f"‚ö†Ô∏è Attention : Le fichier robots.txt interdit l'acc√®s √† {url}")
        return allowed
    except Exception as e:
        print(f"Erreur lors de la lecture du robots.txt : {e}")
        return True # On continue par d√©faut si erreur de lecture, mais avec prudence

def parse_value(value_str):
    """
    (Nettoyage) Convertit les "M", "B", "T" en chiffres.
    """
    if not value_str or value_str == 'N/A':
        return 0

    value_str = value_str.replace(',', '').strip()
    try:
        if value_str.endswith('T'):
            return float(value_str[:-1]) * 1_000_000_000_000
        elif value_str.endswith('B'):
            return float(value_str[:-1]) * 1_000_000_000
        elif value_str.endswith('M'):
            return float(value_str[:-1]) * 1_000_000
        elif value_str.endswith('k'):
            return float(value_str[:-1]) * 1_000
        else:
            return float(value_str)
    except ValueError:
        return 0

def get_page_data(offset=0):
    """
    (Point C: Robustesse) R√©cup√®re et parse une page avec gestion d'erreurs.
    """
    url = f"{BASE_URL}?count=100&offset={offset}"

    # 1. V√©rification Robots.txt avant chaque requ√™te majeure (ou une fois au d√©but)
    # Ici on le fait dans le main pour ne pas ralentir, mais c'est le principe.

    print(f"üì• T√©l√©chargement : {url}...")

    try:
        response = requests.get(url, headers=HEADERS, timeout=10)

        # Gestion des erreurs HTTP (404, 500, etc.)
        response.raise_for_status()

    except requests.exceptions.RequestException as e:
        print(f"‚ùå Erreur de connexion : {e}")
        return []

    soup = BeautifulSoup(response.text, 'html.parser')

    # S√©lecteurs CSS (A v√©rifier souvent car Yahoo change ses classes)
    # On utilise une m√©thode plus g√©n√©rique pour la robustesse : chercher le tableau
    stock_list = []

    # Essai de trouver le tableau principal
    table = soup.find('table')
    if not table:
        print("‚ùå Impossible de trouver le tableau de donn√©es. La structure du site a peut-√™tre chang√©.")
        return []

    rows = table.find('tbody').find_all('tr')

    for row in rows:
        try:
            cols = row.find_all('td')
            if len(cols) < 5:
                continue

            # Extraction s√©curis√©e (Point C)
            ticker = cols[0].text.strip()
            name = cols[1].text.strip()
            price = parse_value(cols[2].text)
            change = cols[3].text.strip()
            volume = parse_value(cols[5].text)
            market_cap = parse_value(cols[7].text)

            stock_data = {
                'Ticker': ticker,
                'Name': name,
                'Price': price,
                'Change': change,
                'Volume': volume,
                'Market_Cap': market_cap
            }
            stock_list.append(stock_data)

        except AttributeError as e:
            # Si une ligne est mal form√©e, on l'ignore sans planter le programme
            continue

    return stock_list

def main():
    """
    (Point A: Automatisation) Fonction principale qui orchestre tout.
    """
    print("--- D√©marrage du Scraper Automatis√© ---")

    # V√©rification √©thique initiale
    if not check_robots_txt(BASE_URL, HEADERS['User-Agent']):
        print("Arr√™t du script pour respect du robots.txt")
        return

    all_stocks = []

    # On boucle pour r√©cup√©rer plusieurs pages (par exemple les 200 premiers)
    # Yahoo affiche par paquets de 100
    for offset in [0, 100]:
        data = get_page_data(offset)
        all_stocks.extend(data)

        # (Point B: √âthique) Pause pour ne pas surcharger le serveur
        print("‚è≥ Pause √©thique de 3 secondes...")
        time.sleep(3)

    # Sauvegarde des donn√©es
    if all_stocks:
        # Cr√©ation du dossier data s'il n'existe pas
        if not os.path.exists(DATA_DIR):
            os.makedirs(DATA_DIR)

        filepath = os.path.join(DATA_DIR, FILENAME)

        df = pd.DataFrame(all_stocks)
        df.to_csv(filepath, index=False)
        print(f"‚úÖ Succ√®s ! {len(df)} actions r√©cup√©r√©es.")
        print(f"üìÅ Donn√©es sauvegard√©es dans : {filepath}")
    else:
        print("‚ö†Ô∏è Aucune donn√©e r√©cup√©r√©e.")

if __name__ == "__main__":
    main()

