"""√âtant donn√© que le volume, la capitalisation boursi√®re et les ratios PE sont parfois repr√©sent√©s avec les lettres M, k et B (pour million, millier et milliard), nous pouvons cr√©er une fonction qui convertit ces valeurs en nombres entiers afin de pouvoir les comparer plus facilement."""

def parse_volume_market_tag(tag):
    volume_str = tag.strip()
    if volume_str[-1] == 'M':
        return int(float(volume_str[:-1]) * 1000000)
    elif volume_str[-1] == 'k':
        return int(float(volume_str[:-1]) * 1000)
    elif volume_str[-1] == 'B':
        return int(float(volume_str[:-1]) * 1000000000)
    elif volume_str[-1] == 'T':
        return int(float(volume_str[:-1]) * 1000000000000)
    else:
        return int(volume_str.replace(',', ''))

