"""### 5. Cr√©ation d'un fichier CSV √† partir des informations analys√©es

Nous pouvons √©crire une fonction qui cr√©e un fichier CSV √† partir de nos informations analys√©es.
"""

def write_csv(items, path):
    with open(path, 'w') as f:
        if len(items) == 0:
            return

        headers = list(items[0].keys())
        f.write(','.join(headers) + '\n')

        for item in items:
            values = []
            for header in headers:
                values.append(str(item.get(header, "")))
            f.write(','.join(values) + "\n")

